import sympy as sp

# define the variables
x = sp.symbols('x')

# define the function
h = -16*x**2 + 100*x + 10

# find the x-intercept by setting y = 0
x_intercept = sp.solve(h, x)

# find the maximum height of the projectile
max_height = sp.solve(sp.diff(h, x), x)

# find the time at which the projectile reaches its maximum height
time = max_height[0]

# find the initial height of the projectile
initial_height = h.subs(x, 0)

# find the time at which the projectile hits the ground
ground_time = sp.solve(h, x)

# determine the real-life meaning of the positive x-intercept of the graph
if x_intercept[0] > 0:
    if max_height[0] > 0:
        if time > 0:
            if initial_height > 0:
                if ground_time[0] > 0:
                    real_life_meaning = "The time at which the projectile reaches its maximum height"
                else:
                    real_life_meaning = "The initial height of the projectile"
            else:
                real_life_meaning = "The time at which the projectile hits the ground"
        else:
            real_life_meaning = "The maximum height of the projectile"
    else:
        real_life_meaning = "The positive x-intercept of the graph"
else:
    real_life_meaning = "The positive x-intercept of the graph"

